description:
How can I use this:
Using Bodystatus;
You can print the code below in your Message Box:
Bodystatus.Call.Calculator(int A, Int B, Int C);
This will give you a status and weight suggest.

This package checks if there is an update available 


To start update a text file like the following content on any web server: 
"1.0" 
Now if you want to change your newest version number just change your text file. 
If you want to change your current version number just change your assembly version. 

Now you can check for updates by doing the following: 

string URL = "http://example.com/Version.txt"; 
bool[] Results = RatzzUpdate.CheckforUpdate(URL); 

Result[0] shows if there is an update available 
Result[1] shows if there was any problem while checking for an update 

You can also check for the current version or newest version by doing this: 

string CurrentVersion = RatzzUpdate.GetCurrentVersion(); 
string NewestVersion = RatzzUpdate.GetNewestVersion(URL);

